import{_ as a,e as p}from"./app.4f6a4bec.js";import{_ as e,a as r,b as i,c as s,d as t,e as l,f as d,g as h,h as c}from"./ball.f0dac666.js";var n="/clover-vuepress/assets/calculation.9a6401be.png",o="/clover-vuepress/assets/table.b1c796cd.png";const _={},m=p('<h1 id="\u0448\u0430\u0440\u043E\u0432\u0430\u044F-\u0437\u0430\u0449\u0438\u0442\u0430-\u043A\u043E\u043F\u0442\u0435\u0440\u0430" tabindex="-1"><a class="header-anchor" href="#\u0448\u0430\u0440\u043E\u0432\u0430\u044F-\u0437\u0430\u0449\u0438\u0442\u0430-\u043A\u043E\u043F\u0442\u0435\u0440\u0430" aria-hidden="true">#</a> \u0428\u0430\u0440\u043E\u0432\u0430\u044F \u0437\u0430\u0449\u0438\u0442\u0430 \u043A\u043E\u043F\u0442\u0435\u0440\u0430</h1><h2 id="\u0432\u0432\u0435\u0434\u0435\u043D\u0438\u0435" tabindex="-1"><a class="header-anchor" href="#\u0432\u0432\u0435\u0434\u0435\u043D\u0438\u0435" aria-hidden="true">#</a> \u0412\u0432\u0435\u0434\u0435\u043D\u0438\u0435</h2><p>\u041D\u0430\u0432\u0435\u0440\u043D\u043E\u0435, \u043B\u0435\u0442\u0430\u0442\u044C \u0432 \u043F\u043E\u043C\u0435\u0449\u0435\u043D\u0438\u044F\u0445 \u043F\u0440\u0438\u0445\u043E\u0434\u0438\u043B\u043E\u0441\u044C \u043A\u0430\u0436\u0434\u043E\u043C\u0443, \u043A\u0442\u043E \u0431\u0440\u0430\u043B \u0432 \u0440\u0443\u043A\u0438 \u043A\u043E\u043F\u0442\u0435\u0440. \u041F\u043E\u0434\u043E\u0431\u043D\u044B\u0435 \u043F\u043E\u043B\u0435\u0442\u044B \u0441\u043E\u043F\u0440\u044F\u0436\u0435\u043D\u044B \u0441 \u043D\u0435\u043C\u0430\u043B\u044B\u043C \u0440\u0438\u0441\u043A\u043E\u043C \u043F\u043E\u0432\u0440\u0435\u0434\u0438\u0442\u044C \u043A\u043E\u043F\u0442\u0435\u0440 \u043E \u0441\u0442\u0435\u043D\u044B \u0438 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0435 \u043F\u0440\u0435\u0434\u043C\u0435\u0442\u044B. \u0414\u0430\u0436\u0435 \u043F\u043E\u043B\u0435\u0442\u044B \u043D\u0430 \u043E\u0442\u043D\u043E\u0441\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0431\u043E\u043B\u044C\u0448\u0438\u0445 \u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u0430\u0445 \u0441\u0432\u044F\u0437\u0430\u043D\u044B \u0441 \u0440\u0438\u0441\u043A\u0430\u043C\u0438 \u0443\u0434\u0430\u0440\u0438\u0442\u044C\u0441\u044F \u043E \u043F\u0440\u0435\u043F\u044F\u0442\u0441\u0442\u0432\u0438\u0435: \u043D\u0430 \u043F\u0443\u0442\u0438 \u043A\u043E\u043F\u0442\u0435\u0440\u0430 \u043C\u043E\u0436\u0435\u0442 \u0432\u0441\u0442\u0430\u0442\u044C \u0441\u0442\u0432\u043E\u043B \u0434\u0435\u0440\u0435\u0432\u0430 \u0438\u043B\u0438 \u0437\u0434\u0430\u043D\u0438\u0435 \u2014 \u0447\u0442\u043E \u0443\u0436 \u0433\u043E\u0432\u043E\u0440\u0438\u0442\u044C \u043E \u043F\u043E\u043B\u0435\u0442\u0430\u0445 \u0432 \u0437\u0430\u043C\u043A\u043D\u0443\u0442\u044B\u0445 \u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u0430\u0445. \u041F\u043E\u0434\u043E\u0431\u043D\u044B\u0435 \xAB\u043A\u0440\u0430\u0448-\u0442\u0435\u0441\u0442\u044B\xBB \u043D\u0435 \u043E\u0447\u0435\u043D\u044C \u043F\u0440\u0438\u044F\u0442\u043D\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043C\u043E\u0436\u0435\u0442 \u043E\u043A\u0430\u0437\u0430\u0442\u044C\u0441\u044F \u0432 \u043B\u0443\u0447\u0448\u0435\u043C \u0441\u043B\u0443\u0447\u0430\u0435 \u043F\u0440\u0438\u0447\u0438\u043D\u043E\u0439 \u043F\u043E\u0442\u0435\u0440\u0438 \u0432\u043D\u0443\u0448\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u0441\u0443\u043C\u043C\u044B \u0434\u0435\u043D\u0435\u0433 \u043D\u0430 \u0440\u0435\u043C\u043E\u043D\u0442, \u0430 \u0432 \u0445\u0443\u0434\u0448\u0435\u043C \u2014 \u0438 \u0432\u043E\u0432\u0441\u0435 \u0443\u0442\u0440\u0430\u0442\u044B \u043A\u043E\u043F\u0442\u0435\u0440\u0430. \u0422\u0435\u043C \u0431\u043E\u043B\u0435\u0435 \u043D\u0435\u043F\u0440\u0438\u044F\u0442\u043D\u044B \u0442\u0430\u043A\u0438\u0435 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u0434\u043B\u044F \u043D\u043E\u0432\u0438\u0447\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u0441\u0432\u043E\u0435\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u0443\u0432\u0435\u0440\u043D\u0443\u0442\u044C\u0441\u044F \u043E\u0442 \u043F\u0440\u0435\u043F\u044F\u0442\u0441\u0442\u0432\u0438\u044F \u0438 \u0442\u043E\u043B\u044C\u043A\u043E \u0443\u0447\u0438\u0442\u0441\u044F \u043B\u0435\u0442\u0430\u0442\u044C.</p><p>\u042D\u0442\u043E \u0432\u0441\u0435 \u043F\u043E\u0434\u0432\u0438\u0433\u043B\u043E \u043D\u0430\u0441 \u043A \u043F\u043E\u0438\u0441\u043A\u0443 \u0440\u0435\u0448\u0435\u043D\u0438\u0439. \u041A \u0441\u043E\u0436\u0430\u043B\u0435\u043D\u0438\u044E, \u043F\u0435\u0440\u0435\u0440\u044B\u0432 \u0432\u0435\u0441\u044C \u0438\u043D\u0442\u0435\u0440\u043D\u0435\u0442, \u043C\u044B \u043D\u0435 \u043D\u0430\u0448\u043B\u0438 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u043B\u0435\u0433\u043A\u043E\u0433\u043E \u0438 \u043F\u0440\u043E\u0441\u0442\u043E\u0433\u043E \u0432 \u0438\u0437\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u0438\u0438 \u0440\u0435\u0448\u0435\u043D\u0438\u044F \u0434\u043B\u044F \u043F\u0440\u043E\u0441\u0442\u044B\u0445 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0435\u0439, \u0430 \u0433\u043B\u0430\u0432\u043D\u043E\u0435 \u2014 \u0442\u0430\u043A\u043E\u0433\u043E, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u0431\u0443\u0434\u0435\u0442 \u0432\u0441\u0435\u043C \u043F\u043E \u043A\u0430\u0440\u043C\u0430\u043D\u0443. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0437\u0430\u0449\u0438\u0442\u0430 \u043F\u043E \u043A\u043E\u043D\u0442\u0443\u0440\u0443 \u043F\u0440\u043E\u043F\u0435\u043B\u043B\u0435\u0440\u043E\u0432 \u043D\u0435\u043F\u043B\u043E\u0445\u043E \u043F\u0440\u0435\u0434\u043E\u0445\u0440\u0430\u043D\u044F\u0435\u0442 \u0441\u0430\u043C\u0438 \u043F\u0440\u043E\u043F\u0435\u043B\u043B\u0435\u0440\u044B, \u043D\u043E \u043F\u0440\u0438 \u043C\u0430\u043B\u0435\u0439\u0448\u0435\u043C \u043A\u0430\u0441\u0430\u043D\u0438\u0438 \u043E \u043F\u0440\u0435\u043F\u044F\u0442\u0441\u0442\u0432\u0438\u0435 \u043A\u043E\u043F\u0442\u0435\u0440 \u043F\u0435\u0440\u0435\u0432\u043E\u0440\u0430\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u0438 \u043F\u0430\u0434\u0430\u0435\u0442. \u0412 \u043E\u0431\u0449\u0435\u043C, \u0437\u0430\u0449\u0438\u0442\u0430 \u043B\u0438\u0431\u043E \u043D\u0435 \u043E\u0431\u0435\u0440\u0435\u0433\u0430\u043B\u0430 \u043A\u043E\u043F\u0442\u0435\u0440 \u043F\u043E\u043B\u043D\u043E\u0441\u0442\u044C\u044E, \u043B\u0438\u0431\u043E \u0432\u044B\u0433\u043B\u044F\u0434\u0435\u043B\u0430 \u043D\u0435\u0441\u0443\u0440\u0430\u0437\u043D\u043E \u0438 \u0431\u044B\u043B\u0430 \u0441\u043B\u0438\u0448\u043A\u043E\u043C \u0443\u0437\u043A\u043E \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u0430.</p><p><img src="'+e+'" alt="safetyball"></p><p>\u041D\u0430\u043C\u0438 \u0431\u044B\u043B\u043E \u043F\u0440\u0438\u043D\u044F\u0442\u043E \u0441\u043B\u043E\u0436\u043D\u043E\u0435 \u0440\u0435\u0448\u0435\u043D\u0438\u0435: \u043F\u0440\u0438\u0434\u0435\u0442\u0441\u044F \u0434\u0435\u043B\u0430\u0442\u044C \u0435\u0435 \u043F\u043E\u043B\u043D\u043E\u0441\u0442\u044C\u044E \u0441\u0430\u043C\u0438\u043C \u0438 \u043F\u043E\u0447\u0442\u0438 \u0441 \u043D\u0443\u043B\u044F, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043F\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u0430 \u0446\u0435\u043B\u044C \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u0435\u0435 \u043F\u0440\u043E\u0441\u0442\u043E\u0439 \u0432 \u0438\u0437\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u0438\u0438 \u0438 \u043C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E \u043B\u0435\u0433\u043A\u043E\u0439.</p><h2 id="\u0440\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u043A\u0430" tabindex="-1"><a class="header-anchor" href="#\u0440\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u043A\u0430" aria-hidden="true">#</a> \u0420\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u043A\u0430</h2><p>\u0412 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0435 \u043F\u043E\u0438\u0441\u043A\u0430 \u0440\u0435\u0448\u0435\u043D\u0438\u044F, \u0443\u0434\u043E\u0432\u043B\u0435\u0442\u0432\u043E\u0440\u044F\u044E\u0449\u0435\u0433\u043E \u0432\u0441\u0435\u043C \u043D\u0430\u0448\u0438\u043C \u0442\u0440\u0435\u0431\u043E\u0432\u0430\u043D\u0438\u044F\u043C, \u043C\u044B \u043E\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u043B\u0438\u0441\u044C \u043D\u0430 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u0438\u0445 \u0441\u0445\u043E\u0436\u0438\u0445 \u0432\u0430\u0440\u0438\u0430\u043D\u0442\u0430\u0445. \u0411\u044B\u043B\u043E \u0440\u0435\u0448\u0435\u043D\u043E \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u0437\u0430\u0449\u0438\u0442\u0443 \u0432 \u0444\u043E\u0440\u043C\u0435 \u043F\u043E\u043B\u0443\u043F\u0440\u0430\u0432\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u043C\u043D\u043E\u0433\u043E\u0433\u0440\u0430\u043D\u043D\u0438\u043A\u0430 (\u043F\u0440\u0438\u043C\u0435\u0440\u0430\u043C\u0438 \u043C\u043E\u0433\u0443\u0442 \u0441\u043B\u0443\u0436\u0438\u0442\u044C \u0444\u0443\u043B\u043B\u0435\u0440\u0435\u043D, \u043C\u043E\u043B\u0435\u043A\u0443\u043B\u0430 \u0443\u0433\u043B\u0435\u0440\u043E\u0434\u0430, \u0438\u043B\u0438 \u0444\u0438\u0433\u0443\u0440\u0430 \u043F\u0435\u043D\u0442\u0430\u043A\u0438\u0441\u0434\u043E\u0434\u0435\u043A\u0430\u044D\u0434\u0440) \u2014 \u0435\u0433\u043E \u043C\u044B \u0438 \u0432\u044B\u0431\u0440\u0430\u043B\u0438 \u043A\u0430\u043A \u0441\u0430\u043C\u044B\u0439 \u043F\u0440\u0438\u044F\u0442\u043D\u044B\u0439 \u0433\u043B\u0430\u0437\u0443. \u041A\u0440\u043E\u043C\u0435 \u0442\u043E\u0433\u043E, \u0442\u0430\u043A\u0430\u044F \u0437\u0430\u0449\u0438\u0442\u0430 \u043B\u0435\u0433\u043A\u043E \u043C\u0430\u0441\u0448\u0442\u0430\u0431\u0438\u0440\u0443\u0435\u043C\u0430 \u043F\u043E\u0434 \u043D\u0443\u0436\u043D\u044B\u0439 \u0440\u0430\u0437\u043C\u0435\u0440.</p><p>\u041F\u0440\u0438 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0438 \u0442\u0430\u043A\u043E\u0439 \u0444\u0438\u0433\u0443\u0440\u044B \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u044E\u0442\u0441\u044F \u0434\u0432\u0430 \u0432\u0438\u0434\u0430 \u0440\u0435\u0431\u0435\u0440 (\u0434\u0430\u043B\u0435\u0435 \u2014 \u043B\u0443\u0447\u0435\u0439): \u043A\u043E\u0440\u043E\u0442\u043A\u0438\u0435 \u0438 \u0434\u043B\u0438\u043D\u043D\u044B\u0435, \u0438\u0445 \u0434\u043B\u0438\u043D\u044B \u0440\u0430\u0441\u0441\u0447\u0438\u0442\u044B\u0432\u0430\u044E\u0442\u0441\u044F \u0438\u0441\u0445\u043E\u0434\u044F \u0438\u0437 \u043D\u0443\u0436\u043D\u043E\u0433\u043E \u0434\u0438\u0430\u043C\u0435\u0442\u0440\u0430 \u0432\u043F\u0438\u0441\u0430\u043D\u043D\u043E\u0439 \u0432 \u043C\u043D\u043E\u0433\u043E\u0433\u0440\u0430\u043D\u043D\u0438\u043A \u0441\u0444\u0435\u0440\u044B. \u0414\u043B\u044F \u043B\u0443\u0447\u0448\u0435\u0433\u043E \u043F\u043E\u043D\u0438\u043C\u0430\u043D\u0438\u044F \u044F \u0432\u0441\u0442\u0430\u0432\u043B\u044E \u0432\u0441\u0435 \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u0435 \u0444\u043E\u0440\u043C\u0443\u043B\u044B \u043D\u0438\u0436\u0435 \u0438\u0437 \xAB\u0412\u0438\u043A\u0438\u043F\u0435\u0434\u0438\u0438\xBB.</p><p><img src="'+n+'" alt="calculation"></p><p>\u0421 \u0443\u0433\u043B\u043E\u0432\u044B\u043C\u0438 \u0441\u043E\u0435\u0434\u0438\u043D\u0435\u043D\u0438\u044F\u043C\u0438 (\u0444\u0438\u0442\u0438\u043D\u0433\u0430\u043C\u0438), \u0442\u043E\u0436\u0435 \u043D\u0435 \u0432\u0441\u0435 \u043F\u0440\u043E\u0441\u0442\u043E: \u0438\u0445 \u0442\u0430\u043A\u0436\u0435 \u0434\u0432\u0430 \u0432\u0438\u0434\u0430 \u2014 \u0441 \u043F\u044F\u0442\u044C\u044E \u0433\u0440\u0430\u043D\u044F\u043C\u0438 \u043F\u0440\u0438 \u0432\u0435\u0440\u0448\u0438\u043D\u0435 (\u043F\u044F\u0442\u044C \u043B\u0443\u0447\u0435\u0439 \u0438\u0441\u0445\u043E\u0434\u044F\u0442 \u0438\u0437 \u0432\u0435\u0440\u0448\u0438\u043D\u044B) \u0438 \u0441 \u0448\u0435\u0441\u0442\u044C\u044E \u0433\u0440\u0430\u043D\u044F\u043C\u0438 (\u0448\u0435\u0441\u0442\u044C \u043B\u0443\u0447\u0435\u0439 \u0438\u0441\u0445\u043E\u0434\u044F\u0442 \u0438\u0437 \u0432\u0435\u0440\u0448\u0438\u043D\u044B).</p><h2 id="\u043F\u0435\u0440\u0432\u044B\u0435-\u043C\u043E\u0434\u0435\u043B\u0438" tabindex="-1"><a class="header-anchor" href="#\u043F\u0435\u0440\u0432\u044B\u0435-\u043C\u043E\u0434\u0435\u043B\u0438" aria-hidden="true">#</a> \u041F\u0435\u0440\u0432\u044B\u0435 \u043C\u043E\u0434\u0435\u043B\u0438</h2><p>\u0411\u044B\u043B\u0430 \u0441\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u0430 \u0441\u043F\u0435\u0446\u0438\u0444\u0438\u043A\u0430\u0446\u0438\u044F \u0434\u043B\u044F \u0443\u0434\u043E\u0431\u0441\u0442\u0432\u0430 \u043A\u043E\u043D\u0442\u0440\u043E\u043B\u044F \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u0430 \u0438\u0437\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u0438\u044F, \u0438 \u043C\u044B \u043F\u0440\u0438\u0441\u0442\u0443\u043F\u0438\u043B\u0438 \u043A \u043C\u043E\u0434\u0435\u043B\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044E.</p><p>\u0421\u0434\u0435\u043B\u0430\u0432 \u043D\u0435\u0441\u043B\u043E\u0436\u043D\u044B\u0435 \u0440\u0430\u0441\u0447\u0435\u0442\u044B \u043F\u043E\u0434 \u043D\u0443\u0436\u043D\u044B\u0435 \u0440\u0430\u0437\u043C\u0435\u0440\u044B, \u043C\u044B \u043F\u043E\u0441\u0442\u0440\u043E\u0438\u043B\u0438 \u043C\u043E\u0434\u0435\u043B\u0438 \u0432 Inventor CAD.</p><p>\u0412 \u0445\u043E\u0434\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u043C\u044B \u0441\u0442\u043E\u043B\u043A\u043D\u0443\u043B\u0438\u0441\u044C \u0441 \u043F\u0440\u043E\u0431\u043B\u0435\u043C\u0430\u043C\u0438 \u0432 \u043C\u043E\u0434\u0435\u043B\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0438 \u0443\u0433\u043B\u043E\u0432\u044B\u0445 \u0441\u043E\u0435\u0434\u0438\u043D\u0435\u043D\u0438\u0439, \u043D\u043E \u043E\u043D\u0438 \u0431\u044B\u043B\u0438 \u0440\u0435\u0448\u0435\u043D\u044B \u0443\u043F\u0440\u043E\u0449\u0435\u043D\u0438\u0435\u043C \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0438, \u0430 \u0440\u0430\u0437\u043D\u043E\u0441\u0442\u044C \u0443\u0433\u043B\u043E\u0432 \u043A\u043E\u043C\u043F\u0435\u043D\u0441\u0438\u0440\u0443\u0435\u0442\u0441\u044F \u0433\u0438\u0431\u043A\u043E\u0441\u0442\u044C\u044E \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u043E\u0432. \u0422\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C, \u0432\u0441\u0435 \u0441\u043E\u0435\u0434\u0438\u043D\u0435\u043D\u0438\u044F \u0441\u0438\u0434\u044F\u0442 \u0432 \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u043E\u043C \u043D\u0430\u0442\u044F\u0433\u0435.</p><p><img src="'+o+'" alt="table"></p><p><img src="'+r+'" alt="elements"></p><p>(\u042D\u043B\u0435\u043C\u0435\u043D\u0442\u044B \u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u044F \u0437\u0430\u0449\u0438\u0442\u044B \u043A \u043A\u043E\u0440\u043F\u0443\u0441\u0443)</p><p><img src="'+i+'" alt="elements1"></p><h2 id="\u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B" tabindex="-1"><a class="header-anchor" href="#\u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B" aria-hidden="true">#</a> \u041C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u044B</h2><p>\u0412 \u0445\u043E\u0434\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u0432\u0441\u0442\u0430\u043B \u0432\u043E\u043F\u0440\u043E\u0441, \u0438\u0437 \u0447\u0435\u0433\u043E \u0436\u0435 \u0432\u0441\u0435-\u0442\u0430\u043A\u0438 \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u0442\u0430\u043A\u0443\u044E \u0437\u0430\u0449\u0438\u0442\u0443, \u0447\u0442\u043E\u0431\u044B \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u043E\u0441\u044C \u043B\u0435\u0433\u043A\u043E \u0438 \u043F\u0440\u043E\u0447\u043D\u043E. \u041E\u0442\u0432\u0435\u0442 \u043F\u0440\u0438\u0448\u0435\u043B, \u043A\u0430\u043A \u0432\u0441\u0435\u0433\u0434\u0430, \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043D\u0435\u043E\u0436\u0438\u0434\u0430\u043D\u043D\u043E. \u041D\u0430 \u0433\u043B\u0430\u0437\u0430 \u043F\u043E\u043F\u0430\u043B\u0438\u0441\u044C \u0448\u043F\u0430\u0436\u043A\u0438 \u0438\u0437 \u0431\u0430\u043C\u0431\u0443\u043A\u0430: \u043E\u043D\u0438 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u0442\u043E\u043D\u043A\u0438\u0435, \u0447\u0442\u043E\u0431\u044B \u043D\u0435 \u043F\u043E\u0432\u043B\u0438\u044F\u0442\u044C \u043D\u0430 \u0430\u044D\u0440\u043E\u0434\u0438\u043D\u0430\u043C\u0438\u043A\u0443, \u0438\u043C\u0435\u044E\u0442 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u0443\u044E \u0433\u0438\u0431\u043A\u043E\u0441\u0442\u044C \u0438 \u043F\u0440\u0438 \u044D\u0442\u043E\u043C \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u043F\u0440\u043E\u0447\u043D\u044B\u0435. \u0414\u0430\u043B\u0435\u0435 \u0432\u043E\u0437\u043D\u0438\u043A \u0432\u043E\u043F\u0440\u043E\u0441, \u0438\u0437 \u0447\u0435\u0433\u043E \u0438 \u043A\u0430\u043A \u0434\u0435\u043B\u0430\u0442\u044C \u0444\u0438\u0442\u0438\u043D\u0433\u0438. \u041A\u043E\u043D\u0435\u0447\u043D\u043E \u0436\u0435, 3D-\u043F\u0435\u0447\u0430\u0442\u044C! 3D-\u043F\u0440\u0438\u043D\u0442\u0435\u0440 \u2014 \u044D\u0442\u043E \u0432\u043E\u043E\u0431\u0449\u0435 \u043D\u0435\u0437\u0430\u043C\u0435\u043D\u0438\u043C\u0430\u044F \u0432\u0435\u0449\u044C, \u0442\u0435\u043C \u0431\u043E\u043B\u0435\u0435 \u0434\u043B\u044F \u0442\u0435\u0445, \u043A\u0442\u043E \u043B\u044E\u0431\u0438\u0442 \u0447\u0442\u043E-\u0442\u043E \u0434\u0435\u043B\u0430\u0442\u044C \u0441\u0430\u043C. \u041A \u0442\u043E\u043C\u0443 \u0436\u0435 \u043E\u043D\u0438 \u0438\u0437-\u0437\u0430 \u043D\u0435 \u0441\u0430\u043C\u043E\u0439 \u0432\u044B\u0441\u043E\u043A\u043E\u0439 \u0446\u0435\u043D\u044B \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u0438 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u0448\u0438\u0440\u043E\u043A\u043E\u0435 \u0440\u0430\u0441\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0438\u0435. \u041D\u0430 \u0442\u0430\u043A\u043E\u043C \u043F\u0440\u0438\u043D\u0442\u0435\u0440\u0435 \u043C\u043E\u0436\u043D\u043E \u0434\u0435\u043B\u0430\u0442\u044C \u0438\u0437\u0434\u0435\u043B\u0438\u044F \u043F\u043E\u0447\u0442\u0438 \u043B\u044E\u0431\u043E\u0439 \u0441\u043B\u043E\u0436\u043D\u043E\u0441\u0442\u0438. \u0422\u043E, \u0447\u0442\u043E \u043D\u0430\u0434\u043E!</p><p>\u0413\u043E\u0442\u043E\u0432\u044B\u0435 \u043C\u043E\u0434\u0435\u043B\u0438 \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0438\u043C \u0432 .stl, \u0437\u0430\u043A\u0438\u0434\u044B\u0432\u0430\u0435\u043C \u0432 \u0441\u043B\u0430\u0439\u0441\u0435\u0440 (\u0432 \u043D\u0430\u0448\u0435\u043C \u0441\u043B\u0443\u0447\u0430\u0435 \u2014 Cura), \u0432\u0432\u043E\u0434\u0438\u043C \u043D\u0430\u0441\u0442\u0440\u043E\u0439\u043A\u0438 \u043F\u043E\u0434 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u044B\u0439 \u043F\u0440\u0438\u043D\u0442\u0435\u0440 \u0438 \u043F\u043B\u0430\u0441\u0442\u0438\u043A \u0438 \u0441\u0442\u0430\u0432\u0438\u043C \u043D\u0430 \u043F\u0435\u0447\u0430\u0442\u044C.</p><p>\u0414\u043B\u044F \u0443\u043C\u0435\u043D\u044C\u0448\u0435\u043D\u0438\u044F \u0432\u0435\u0441\u0430 \u0431\u044B\u043B \u0432\u044B\u0431\u0440\u0430\u043D ABC-\u043F\u043B\u0430\u0441\u0442\u0438\u043A \u043A\u0430\u043A \u043E\u0434\u0438\u043D \u0438\u0437 \u0441\u0430\u043C\u044B\u0445 \u043B\u0435\u0433\u043A\u0438\u0445 \u0438 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0445.</p><p><img src="'+s+'" alt="3dmodel"></p><p>\u0428\u043F\u0430\u0436\u043A\u0438 \u0431\u044B\u043B\u0438 \u043F\u043E\u0440\u0435\u0437\u0430\u043D\u044B \u043D\u0430 \u0440\u0430\u0441\u0447\u0435\u0442\u043D\u044B\u0435 \u0434\u043B\u0438\u043D\u044B \u0438 \u043F\u043E\u0434\u0433\u043E\u0442\u043E\u0432\u043B\u0435\u043D\u044B \u043A \u043F\u043E\u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0439 \u0440\u0430\u0431\u043E\u0442\u0435.</p><h2 id="\u0441\u0431\u043E\u0440\u043A\u0430-\u0438-\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430" tabindex="-1"><a class="header-anchor" href="#\u0441\u0431\u043E\u0440\u043A\u0430-\u0438-\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430" aria-hidden="true">#</a> \u0421\u0431\u043E\u0440\u043A\u0430 \u0438 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0430</h2><p>\u041F\u043E\u0441\u043B\u0435 \u0442\u043E\u0433\u043E \u043A\u0430\u043A \u0432\u0441\u0435 \u0431\u044B\u043B\u043E \u043D\u0430\u043F\u0435\u0447\u0430\u0442\u0430\u043D\u043E \u0438 \u043F\u043E\u0440\u0435\u0437\u0430\u043D\u043E, \u043D\u0430\u0441\u0442\u0430\u043B\u043E \u0432\u0440\u0435\u043C\u044F \u0441\u043E\u0431\u0438\u0440\u0430\u0442\u044C \u0437\u0430\u0449\u0438\u0442\u0443.</p><p><img src="'+t+'" alt="detal"></p><p>\u0421\u0431\u043E\u0440\u043A\u0430 \u0437\u0434\u0435\u0441\u044C \u0441\u0430\u043C\u044B\u0439 \u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442, \u0442\u0430\u043A \u043A\u0430\u043A \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0430\u043B\u0433\u043E\u0440\u0438\u0442\u043C\u0430.</p><p>\u0418\u0437 \u043F\u044F\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u043E\u0433\u043E \u0444\u0438\u0442\u0438\u043D\u0433\u0430 \u0432\u044B\u0445\u043E\u0434\u044F\u0442 \u0442\u043E\u043B\u044C\u043A\u043E \u043A\u043E\u0440\u043E\u0442\u043A\u0438\u0435 \u043B\u0443\u0447\u0438, \u0432 \u0442\u043E \u0432\u0440\u0435\u043C\u044F \u043A\u0430\u043A \u0438\u0437 \u0448\u0435\u0441\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u043E\u0433\u043E \u2014 \u0442\u043E\u043B\u044C\u043A\u043E \u043A\u0430\u0436\u0434\u0430\u044F \u0432\u0442\u043E\u0440\u0430\u044F \u0434\u043B\u0438\u043D\u043D\u0430\u044F.</p><p>\u0421\u0431\u043E\u0440\u043A\u0430:</p><ol><li>\u0412\u043D\u0430\u0447\u0430\u043B\u0435 \u0441\u043E\u0431\u0438\u0440\u0430\u0435\u043C \u0432\u0441\u0435 \u043F\u044F\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u044B\u0435 \u0432\u0435\u0440\u0448\u0438\u043D\u044B.</li><li>\u041D\u0430 \u043A\u0430\u0436\u0434\u044B\u0439 \u043B\u0443\u0447, \u0438\u0441\u0445\u043E\u0434\u044F\u0449\u0438\u0439 \u0438\u0437 \u043F\u044F\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u043E\u0439 \u0432\u0435\u0440\u0448\u0438\u043D\u044B, \u043D\u0430\u0434\u0435\u0432\u0430\u0435\u043C \u0448\u0435\u0441\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u0443\u044E.</li><li>\u0421\u043E\u0435\u0434\u0438\u043D\u044F\u0435\u043C \u043C\u0435\u0436\u0434\u0443 \u0441\u043E\u0431\u043E\u0439 \u0448\u0435\u0441\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u044B\u0435 \u0444\u0438\u0442\u0438\u043D\u0433\u0438 \u0434\u043B\u0438\u043D\u043D\u044B\u043C\u0438 \u0448\u043F\u0430\u0436\u043A\u0430\u043C\u0438.</li><li>\u041F\u0440\u0438\u0441\u043E\u0435\u0434\u0438\u043D\u044F\u0435\u043C \u0443\u0436\u0435 \u0441\u043E\u0431\u0440\u0430\u043D\u043D\u044B\u0435 \u043F\u044F\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u044B\u0435 \u0432\u0435\u0440\u0448\u0438\u043D\u044B \u043A \u0448\u0435\u0441\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u044B\u043C, \u0443\u0447\u0438\u0442\u044B\u0432\u0430\u044F, \u0447\u0442\u043E \u0432 \u0448\u0435\u0441\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u043E\u043C \u0444\u0438\u0442\u0438\u043D\u0433\u0435 \u043A\u043E\u0440\u043E\u0442\u043A\u0438\u0435 \u0438 \u0434\u043B\u0438\u043D\u043D\u044B\u0435 \u043B\u0443\u0447\u0438 \u0447\u0435\u0440\u0435\u0434\u0443\u044E\u0442\u0441\u044F.</li><li>\u041F\u043E\u0432\u0442\u043E\u0440\u044F\u0435\u043C \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u0434\u043B\u044F \u043A\u0430\u0436\u0434\u043E\u0439 \u043F\u044F\u0442\u0438\u043B\u0443\u0447\u0435\u0432\u043E\u0439 \u0432\u0435\u0440\u0448\u0438\u043D\u044B, \u043F\u043E\u043A\u0430 \u0448\u0430\u0440 \u043D\u0435 \u0441\u043E\u0431\u0435\u0440\u0435\u0442\u0441\u044F.</li></ol><p>\u041F\u043E\u0441\u043B\u0435 \u0441\u0431\u043E\u0440\u043A\u0438 \u0440\u0430\u0437\u0434\u0435\u043B\u044F\u0435\u043C \u0448\u0430\u0440 \u043D\u0430 \u0434\u0432\u0435 \u043F\u043E\u043B\u0443\u0441\u0444\u0435\u0440\u044B, \u0443\u0441\u0442\u0430\u043D\u0430\u0432\u043B\u0438\u0432\u0430\u0435\u043C \u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u044F \u043D\u0430 \u043A\u043E\u043F\u0442\u0435\u0440, \u0441\u043C\u043E\u0442\u0440\u0438\u043C, \u0447\u0442\u043E \u0432\u0441\u0435 \u043F\u043E\u0434\u0445\u043E\u0434\u0438\u0442.</p><p><img src="'+l+'" alt="detal1"></p><p><img src="'+d+'" alt="detal2"></p><p>(\u041F\u0440\u0438\u043C\u0435\u0440 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u0439)</p><p>\u0422\u0435\u043F\u0435\u0440\u044C \u043F\u043E\u043B\u0443\u0441\u0444\u0435\u0440\u044B \u043C\u043E\u0436\u043D\u043E \u043F\u0440\u043E\u043A\u043B\u0435\u0438\u0432\u0430\u0442\u044C. \u041C\u0435\u0436\u0434\u0443 \u0441\u043E\u0431\u043E\u0439 \u043F\u043E\u043B\u0443\u0441\u0444\u0435\u0440\u044B \u043D\u0435 \u0441\u043A\u043B\u0435\u0438\u0432\u0430\u044E\u0442\u0441\u044F \u2014 \u044D\u0442\u043E \u043D\u0443\u0436\u043D\u043E \u0434\u043B\u044F \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u043A\u043E\u043F\u0442\u0435\u0440\u0430 \u0432\u043D\u0443\u0442\u0440\u044C. \u041C\u044B \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043A\u043B\u0435\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043B\u0438 \u0440\u0430\u0441\u0442\u0432\u043E\u0440\u0438\u0442\u0435\u043B\u044C \u0434\u043B\u044F \u043F\u043B\u0430\u0441\u0442\u0438\u043A\u043E\u0432 \xAB\u0414\u0438\u0445\u043B\u043E\u0440\u044D\u0442\u0430\u043D\xBB, \u043D\u043E \u0441 \u0442\u0435\u043C \u0436\u0435 \u0443\u0441\u043F\u0435\u0445\u043E\u043C \u043C\u043E\u0436\u043D\u043E \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0438 \u043B\u044E\u0431\u043E\u0439 \u0431\u044B\u0441\u0442\u0440\u043E\u0441\u043E\u0445\u043D\u0443\u0449\u0438\u0439 \u043A\u043B\u0435\u0439 \u0434\u043B\u044F \u043F\u043E\u043B\u0438\u043C\u0435\u0440\u043E\u0432.</p><p>\u041F\u043E\u0441\u043B\u0435 \u0432\u044B\u0441\u044B\u0445\u0430\u043D\u0438\u044F \u0437\u0430\u0449\u0438\u0442\u0430 \u0433\u043E\u0442\u043E\u0432\u0430 \u043A \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0438 \u043F\u0435\u0440\u0432\u044B\u043C \u043F\u0440\u043E\u0431\u043D\u044B\u043C \u043F\u043E\u043B\u0435\u0442\u0430\u043C!</p><p><img src="'+h+'" alt="finalball"></p><p>(\u041F\u043E\u043A\u0430 \u0435\u0449\u0435 \u0431\u0435\u0437 \u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u0439)</p><p><img src="'+c+'" alt="ball"></p><h2 id="\u043F\u0435\u0440\u0432\u044B\u0435-\u043F\u043E\u043B\u0435\u0442\u044B" tabindex="-1"><a class="header-anchor" href="#\u043F\u0435\u0440\u0432\u044B\u0435-\u043F\u043E\u043B\u0435\u0442\u044B" aria-hidden="true">#</a> \u041F\u0435\u0440\u0432\u044B\u0435 \u043F\u043E\u043B\u0435\u0442\u044B</h2><p>\u041C\u044B \u0434\u0435\u043B\u0430\u043B\u0438 \u0437\u0430\u0449\u0438\u0442\u0443 \u043F\u043E\u0434 \u043A\u043E\u043F\u0442\u0435\u0440 \xAB\u041A\u043B\u0435\u0432\u0435\u0440 2\xBB, \u044F\u0432\u043B\u044F\u044E\u0449\u0438\u0439\u0441\u044F \u043E\u0431\u0443\u0447\u0430\u044E\u0449\u0438\u043C \u043F\u043E\u0441\u043E\u0431\u0438\u0435\u043C \u043F\u043E \u0441\u0431\u043E\u0440\u043A\u0435 \u0438 \u043D\u0430\u0441\u0442\u0440\u043E\u0439\u043A\u0435 \u043A\u0432\u0430\u0434\u0440\u043E\u043A\u043E\u043F\u0442\u0435\u0440\u043E\u0432, \u0438 \u043D\u0430 \u043D\u0435\u0433\u043E \u043E\u043D\u0430 \u0443\u0441\u0442\u0430\u043D\u0430\u0432\u043B\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u0431\u0435\u0437 \u0434\u043E\u0440\u0430\u0431\u043E\u0442\u043E\u043A. \u0417\u0430\u0449\u0438\u0442\u0430 \u0432\u0435\u0441\u0438\u0442 \u043D\u0430 70 \u0433 \u0431\u043E\u043B\u044C\u0448\u0435 (139 \u0433\u0440\u0430\u043C\u043C), \u0447\u0435\u043C \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u043D\u0430\u044F, \u0438 \u043D\u0430 \u0443\u043F\u0440\u0430\u0432\u043B\u044F\u0435\u043C\u043E\u0441\u0442\u044C \u0438 \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u043B\u0435\u0442\u0430 \u043F\u043E\u0447\u0442\u0438 \u043D\u0435 \u0432\u043B\u0438\u044F\u0435\u0442.</p><p>\u041E\u0442\u0434\u0435\u043B\u044C\u043D\u043E \u0441\u0442\u043E\u0438\u0442 \u0441\u043A\u0430\u0437\u0430\u0442\u044C, \u0447\u0442\u043E \u0438\u0437\u043B\u0438\u0448\u043D\u0438\u0435 \u0432\u0438\u0431\u0440\u0430\u0446\u0438\u0438, \u0435\u0441\u043B\u0438 \u0442\u0430\u043A\u043E\u0432\u044B\u0435 \u0438\u043C\u0435\u044E\u0442\u0441\u044F, \u043C\u043E\u0436\u043D\u043E \u0443\u0431\u0440\u0430\u0442\u044C \u043F\u0443\u0442\u0435\u043C \u0431\u043E\u043B\u0435\u0435 \u0436\u0435\u0441\u0442\u043A\u043E\u0433\u043E \u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0438\u044F \u0437\u0430\u0449\u0438\u0442\u044B \u043A \u043A\u043E\u043F\u0442\u0435\u0440\u0443.</p><p>\u0412 \u0438\u0442\u043E\u0433\u0435 \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u0430\u0441\u044C \u043D\u0435\u043E\u0431\u044B\u0447\u043D\u0430\u044F \u0437\u0430\u0449\u0438\u0442\u0430 \u0434\u043B\u044F \u043A\u043E\u043F\u0442\u0435\u0440\u0430 \u0441 \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u0438\u043C \u0432\u0435\u0441\u043E\u043C \u0438 \u0438\u043D\u0442\u0435\u0440\u0435\u0441\u043D\u044B\u043C \u0434\u0438\u0437\u0430\u0439\u043D\u043E\u043C, \u043E\u0442\u043A\u0440\u044B\u0432\u0430\u044E\u0449\u0430\u044F \u043D\u043E\u0432\u044B\u0435 \u0433\u043E\u0440\u0438\u0437\u043E\u043D\u0442\u044B \u0434\u043B\u044F \u043F\u043E\u043B\u0435\u0442\u043E\u0432 \u0432 \u0442\u0435\u0445 \u043C\u0435\u0441\u0442\u0430\u0445, \u0433\u0434\u0435 \u043B\u0435\u0442\u0430\u0442\u044C \u0434\u043B\u044F \u043A\u043E\u043F\u0442\u0435\u0440\u0430 \u0440\u0430\u043D\u044C\u0448\u0435 \u0431\u044B\u043B\u043E \u043E\u043F\u0430\u0441\u043D\u043E.</p>',45);function f(u,b){return m}var v=a(_,[["render",f],["__file","shield.html.vue"]]);export{v as default};
